import React from 'react';
import '../../App.css';

export default function PopUp({ currentPatient }) {
  return <div>
      { typeof currentPatient !== "undefined" &&
        currentPatient.map((patient) => (
          <div key={ patient.id }>
            <p>{ patient.first_name }</p>
            <p>{ patient.last_name }</p>
            <p style={{ textAlign: 'center' }}>{ patient.age }</p>
            <p style={{
              textAlign: 'center',
              color: patient.gender === 'Male' ? 'blue' : 'rgb(255, 0, 255)',
              }}
            >
              { patient.gender }
            </p>
            <p>
              <button className="save-btn">Save Changes</button>
              <button className="cancel-btn">Cancel</button>
            </p>
          </div>
        ))
      }
  </div>
};
